DROP TABLE Person;

CREATE TABLE "Person" (
"Id" integer primary key autoincrement not null,
"FirstName" varchar,
"LastName" varchar)


CREATE TABLE "Prices" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_Prices" PRIMARY KEY AUTOINCREMENT,
    "UserId" TEXT NULL,
    "CreatedAt" TEXT NOT NULL,
    "Date" TEXT NOT NULL,
    "Open" REAL NULL,
    "High" REAL NULL,
    "Low" REAL NULL,
    "Close" REAL NULL,
    "AdjustedClose" REAL NOT NULL,
    "Volume" REAL NULL,
    "CurrentHoldings" REAL NULL,
    "Symbol" TEXT NULL,
    "Pct_Change" REAL NULL
)

